import React, { useState } from "react";
import VectorielConst from "./Const/vectoriel";
import '../App.css'


function Vectoriel () {
    const [image,setImage] = useState(VectorielConst)

    const matriciel =
    <div className="vectoriel">
        <div className="container my-auto text-center">
            <h1 className="py-4"> Dessin vectoriel</h1>
            <div className="row">
            {image.map((e,i)=>
                <div class="card text-center col-lg-4 my-auto mx-auto BG p-4 rounded-5" key={i} onClick={()=>{window.open(e.ur2)}}>
                <img src={e.url} className="card-img-top" alt={e.nom}/>
                <div class="card-body">
                  <h5 class="card-title">{e.nom}</h5>
                  <a href={e.url2} class="btn btn-primary">Voir l'image en taille réelle</a>
                </div>
              </div>
            )}
            </div>
        </div>
    </div>

    return (matriciel)
}

export default Vectoriel
